import React from 'react'
import '../Css/NewsFeed.css'
import { Link } from 'react-router-dom'

function NewsFeed() {
    return (
        <div>
            {/* News Feed Navbar */}
            <nav className="feeds-nav">
                <div class="icons">
                    <Link to="/"><i className="fas fa-home"></i> </Link>
                </div>
            </nav>

            {/* End of News Feed Navbar */}
        </div>
    )
}

export default NewsFeed
